import React from 'react';

const Video =()=>{
    return(
        <>
        <div class="row">
            <div class="col-12 mb-4">
                <div class="ratio ratio-16x9">
                    <div id="videoPlaceholder" class="bg-light rounded shadow-lg d-flex justify-content-center align-items-center" style="width: 100%; height: 100%;">
                        <span class="text-muted">비디오 미리보기</span>
                    </div>
                    <video id="liveVideoFeed" class="rounded shadow-lg" autoplay muted style="width: 100%; height: 100%; display: none;"></video>
                    <video id="videoPlayback" class="rounded shadow-lg" style="width: 100%; height: 100%; display: none;"></video>
                </div>
            </div>
        </div>
        </>
    );
}

export default Video;
